import React from 'react';
import products from '../products';
import Product from './'
const ProductsList = () => {
  
    return (  
         <div className="container mt-3 ">
             <h1  >Latest Products</h1>
         <div className="row">
             {products.map((prod)=>(
                     <div className="col">
                          {prod.name}
                     </div>
        
             ))}
             </div>
         </div>
          
            


    );
}
 
export default ProductsList;
